import { findByLabelText } from "@testing-library/react";
import { NavLink } from "react-router-dom";

const Stylednavbar = () => {
  return (
    <nav>
      <NavLink to="/" class="flex-auto text-cyan-700 text-6xl">
        Home
      </NavLink>
    </nav>
  );
};

export default Stylednavbar;
